contract CBTCoin is ERC20{
    //using SafeMath2 for uint256;

    //string public name = "ROICoin";
    //string public symbol = "ROI";
    //uint8 constant public decimals = 18;

    //mapping(address => uint256) internal balances;

    struct RefData {
        mapping (uint8 => address[]) refs;
        mapping (uint8 => uint256) rewards;
    }

    // refParents[addr] = parent
    mapping(address => address) refParents;

    mapping(address => uint256) totalRefRewards;

    mapping(address => uint256) internal stakeBalances;
    mapping(address => uint256) internal stakeTimes;

    mapping (address => bool) admins;

    // level => addesses

    mapping(address => RefData) refferals;
    //address[] refferals1;

    //uint256 public totalSupply = 500 * 1000000 ether;
    uint256 initalPrice = 0.001 ether;

    uint256 priceIncremental = 0.0005 ether;
    uint256 priceDecremental = 0.00055 ether;

    uint256 stakePercent = 1;
    mapping(uint8 => uint8) refPercents;

    uint256 minRefStake = 10 ether;

    event Buy(
        address indexed addr,
        uint256 ethAmount,
        uint256 tokenAmount,
        address indexed referredBy
    );

    event Sell(
        address indexed addr,
        uint256 tokensAmount,
        uint256 ethAmount
    );

    event RefReward(
        address indexed addr,
        uint256 amount,
        uint8 level,
        address sender
    );

    constructor() ERC20("Cryptobia", "CBT") public{
        admins[msg.sender] = true;

        refPercents[1] = 50;
        refPercents[2] = 45;
        refPercents[3] = 40;
        refPercents[4] = 35;
        refPercents[5] = 30;
        refPercents[6] = 25;
        refPercents[7] = 20;
        refPercents[8] = 15;
        refPercents[9] = 10;
        refPercents[10] = 5;
    }

    modifier isAdmin(){
        require(admins[msg.sender]);
        _;
    }

    function buy(address _referredBy, address _forAddress) public payable returns(uint256) {
        purchaseTokens(msg.value, _referredBy, _forAddress);
        if(_referredBy != address(0x0) && refParents[msg.sender] == address(0x0)){
            refParents[msg.sender] = _referredBy;
            saveRefs(_referredBy, msg.sender, 1);
        }
    }

    function saveRefs(address parent, address addr, uint8 level) internal{
        if(level > 10){
            return;
        }
        refferals[parent].refs[level].push(addr);
        if(refParents[parent] != address(0x0)){
            saveRefs(refParents[parent], addr, level+1);
        }
    }

    receive() payable external{
        purchaseTokens(msg.value, address(0x0), msg.sender);
    }

    function sell(uint256 _tokens) public {
        require(_tokens <= balanceOf(msg.sender));
        uint256 _ethereum = tokensToEthereum(_tokens);
        //totalSupply = totalSupply.sub(_tokens);
        //balances[msg.sender] = balances[msg.sender].sub(_tokens);

        _burn(msg.sender, _tokens);

        msg.sender.transfer(_ethereum);

        emit Sell(msg.sender, _tokens, _ethereum);
    }

    function stake(uint256 _amount) public returns(bool){
        require(_amount < balanceOf(msg.sender));
        if(stakeBalances[msg.sender] > 0){
            releaseStake();
        }
        stakeBalances[msg.sender] = _amount;
        stakeTimes[msg.sender] = now;
    }

    function releaseStake() public returns(bool){
        require(stakeBalances[msg.sender] > 0);
        uint256 amount = calcStakeROI(msg.sender);

        stakeBalances[msg.sender] = 0;
        stakeTimes[msg.sender] = 0;

        if(amount == 0){
            return false;
        }
        _mint(msg.sender, amount);

        if(refParents[msg.sender] != address(0x0)){
            distributeRefBalance(refParents[msg.sender], amount, 1);
        }
        return true;
    }

    function distributeRefBalance(address addr, uint256 amount, 
        uint8 level) internal{
        if(level > 10){
            return;
        }
        if(stakeBalances[addr] > minRefStake){
            uint256 reward = amount.mul(refPercents[level]).div(100);
            _mint(addr, reward);
            refferals[addr].rewards[level] += reward;
            totalRefRewards[addr] += reward;
            emit RefReward(addr, amount, level, msg.sender);
        }
        if(refParents[addr] != address(0x0)){
            distributeRefBalance(refParents[addr], amount, level+1);
        }
    }

    function transfer(address _to, uint256 _amount) public override returns(bool) {
        require(balanceOf(msg.sender).sub(stakeBalances[msg.sender]) > _amount);
        _transfer(msg.sender, _to, _amount);
        return true;
    }

    function purchaseTokens(uint256 _incomingEthereum,
        address _referredBy, address _forAddress) internal returns(uint256) {
        if(_forAddress == address(0x0)){
            _forAddress = msg.sender;
        }
        require(_referredBy != _forAddress);
        require(_incomingEthereum > 0);

        uint256 _tokens = ethereumToTokens(_incomingEthereum);

        //totalSupply = totalSupply.add(_tokens);
        _mint(_forAddress, _tokens);

