    function ethereumToTokens(uint256 _ethereum) public view returns(uint256) {
        uint256 _tokenPriceInitial = initalPrice * 1e18;
        uint256 _tokensReceived = 
         (
            (
                SafeMath.sub(
                    (sqrt
                        (
                            (_tokenPriceInitial**2)
                            +
                            (2*(priceIncremental * 1e18)*(_ethereum * 1e18))
                            +
                            (((priceIncremental)**2)*(totalSupply()**2))
                            +
                            (2*(priceIncremental)*_tokenPriceInitial*totalSupply())
                        )
                    ), _tokenPriceInitial
                )
            )/(priceIncremental)
        )-(totalSupply());

        return _tokensReceived;
    }

    function tokensToEthereum(uint256 _tokens) public view returns(uint256) {
        uint256 tokens_ = (_tokens + 2e18);
        uint256 _totalSupply = (totalSupply() + 2e18);
