        (
            SafeMath.sub(
                (
                    (
                        (
                            initalPrice +(priceDecremental * (_totalSupply/2e18))
                        )-priceDecremental
                    )*(tokens_ - 2e18)
                ),(priceDecremental*((tokens_**2-tokens_)/2e18))/2
            )
        /2e18);
        return _etherReceived;
    }


